import React from 'react'
import { Formik, Form, Field, ErrorMessage } from 'formik'

function CreatePost() {

    return (
        <div className="create-post-page">
            <Formik>
                <Form>
                    <Field id="input-create-post" name="title" placeholder="Title" />
                </Form>
            </Formik>
        </div>
    )
};

export default CreatePost;
